import styled from "styled-components";
import LogoImage from '../../assets/image/logo.png';

const Header = () => {

    return (
        <div>
            <BtnLogo><ImgLogo src={LogoImage} alt="logo"/></BtnLogo>
            {/* <button><img src={LogoImage} alt="logo"/></button> */}
        </div>
    );
}


const BtnLogo = styled.button`
    width: 175px;
    height: 79px;
`;

const ImgLogo = styled.img`
    width: 175px;
    height: 79px;
`;

export default Header;
